&reftitle.description;
public boolImagickDraw::pop
&warn.undocumented.func;
Уничтожает текущий объект ImagickDraw в стеке и возвращается к ранее добавленному объекту ImagickDraw. Может существовать несколько изображений ImagickDraw. Попытка извлечь больше изображений ImagickDraw, чем было добавлено, приведёт к возникновению ошибки, правильным использованием является извлечение только тех изображений ImagickDraw, которые были добавлены в стек.
